import { Injectable } from '@angular/core';

@Injectable({
  providedIn: 'root',
})
export class AuthGuard {
  canActivate(): boolean {
    if (localStorage.getItem('name') === '' && localStorage.getItem('surname')) {
      return true;
    } else {
      return false;
    }
  }
}
